import React,{useRef,useState,useEffect} from 'react'

export default function Mapping() {

    const width = 100
    const height = 100
    const pixelRatio = window.devicePixelRatio

      const canvas = useRef(null)
    
      useEffect(() => {
        const context = canvas.current.getContext("2d")
    
        context.save()
        context.scale(pixelRatio, pixelRatio)
        context.fillStyle = "hsl(0, 0%, 95%)"
        context.fillRect(0, 0, width, height);
    
        context.strokeStyle = "black";
        context.beginPath();
        context.arc(width / 2, height / 2, width / 4, 0, Math.PI * 2);
        context.stroke();
        context.restore();
      })
    
      const dw = Math.floor(pixelRatio * width);
      const dh = Math.floor(pixelRatio * height);
      const style = { width, height };
    return (
        <div className="mapping">
            <canvas ref={canvas} width={dw} height={dh} style={style}/>
            <img src="mapping.png" alt="mapping" className="mapping-img"/>
        </div>        
        // bg-light        
        // style={onClick ? {height: 300}: {height: 455}}
    )
}
